 * Returns the current context.
 *
 * @return   the current context, or the default context if <code>setContext()</code>
 *      hasn't been invoked
 * @see      #setContext(java.lang.Object)
 */
public Object getContext()
{
    if (Context != null)
    {
        return Context;
    }
    else
    {
        return dflt_context;
    }
}

